import { Menu, Icon } from 'antd'
import styled from 'styled-components'
import { Link } from 'react-router-dom'

const StyledMenu = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`

const StyledApp = styled.div`
  width: 100%;
  height: 100%;
`

export default ({ children }) => {
  const menuEntries = [
    {
      title: 'Search',
